// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Metadata.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Pausable.sol";
import "./Wizards.sol";
import "./Scepters.sol";

/**
 * @dev {ERC721} token, including:
 *
 *  - ability for holders to burn (destroy) their tokens
 *  - a minter role that allows for token minting (creation)
 *  - a pauser role that allows to stop all token transfers
 *  - token ID and URI autogeneration
 *
 * This contract uses {AccessControl} to lock permissioned functions using the
 * different roles - head to its documentation for details.
 *
 * The account that deploys the contract will be granted the minter and pauser
 * roles, as well as the default admin role, which will let it grant both minter
 * and pauser roles to other accounts.
 */
contract Covens is
    Context,
    AccessControlEnumerable,
    ERC721Enumerable,
    ERC721Burnable,
    ERC721Pausable
{
    using Strings for uint256;
    using Counters for Counters.Counter;
    using EnumerableSet for EnumerableSet.UintSet;

    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");

    Counters.Counter private _tokenIdTracker;

    string private _baseTokenURI;

    struct Coven {
        uint256 id;
        uint256 creationTime;
        uint256 totalResearchCapacity;
        uint256 maxScepters;
        uint256 latestPotionTime;
        uint256[] wizards;
        uint256[] scepters;
        uint256 powerCrystals;
    }

    mapping(uint256 => Coven) covens;

    /**
     * @dev Grants `DEFAULT_ADMIN_ROLE`, `MINTER_ROLE` and `PAUSER_ROLE` to the
     * account that deploys the contract.
     *
     * Token URIs will be autogenerated based on `baseURI` and their token IDs.
     * See {ERC721-tokenURI}.
     */
    constructor(
        string memory name,
        string memory symbol,
        string memory baseTokenURI
    ) ERC721(name, symbol) {
        _baseTokenURI = baseTokenURI;

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());

        _setupRole(MINTER_ROLE, _msgSender());
        _setupRole(PAUSER_ROLE, _msgSender());
    }

    function getType(uint256 tokenId) internal view returns (uint256) {
        uint256 totalPower = covens[tokenId].totalResearchCapacity;
        if (totalPower < 1000) {
            return 0;
        } else if (totalPower < 2000) {
            return 1;
        } else if (totalPower < 3000) {
            return 2;
        } else if (totalPower < 4000) {
            return 3;
        } else {
            return 4;
        }
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _baseTokenURI;
    }


    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        string memory baseURI = _baseURI();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, getType(tokenId).toString())) : "";
    }

    /**
     * @dev Creates a new token for `to`. Its token ID will be automatically
     * assigned (and available on the emitted {IERC721-Transfer} event), and the token
     * URI autogenerated based on the base URI passed at construction.
     *
     * See {ERC721-_mint}.
     *
     * Requirements:
     *
     * - the caller must have the `MINTER_ROLE`.
     */
    function mint(
        address to, 
        uint256 totalResearchCapacity,
        uint256 maxScepters,
        uint256[] memory scepters,
        uint256[] memory wizards
        ) public virtual {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");

        // We cannot just use balanceOf to create the new tokenId because tokens
        // can be burned (destroyed), so we need a separate counter.
        _mint(to, _tokenIdTracker.current());
        covens[_tokenIdTracker.current()] = Coven({
            id: _tokenIdTracker.current(),
            creationTime: block.timestamp,
            totalResearchCapacity: totalResearchCapacity,
            maxScepters: maxScepters,
            scepters: scepters,
            wizards: wizards,
            latestPotionTime: 0,
            powerCrystals: 0
        });
        _tokenIdTracker.increment();
    }

    function removeScepter(uint256 id, uint256 idScepter, uint256 amountResearchCapacity) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        bool found = false;
        for (uint256 i = 0; i < covens[id].scepters.length && !found; i++) {
            if (covens[id].scepters[i] == idScepter) {
                covens[id].scepters[i] = covens[id].scepters[covens[id].scepters.length-1];
                covens[id].scepters.pop();
                found = true;
            }
        }
        require(found);
        covens[id].totalResearchCapacity -= amountResearchCapacity;
    }

    function removeWizard(uint256 id, uint256 idWizard, uint256 amountSlots) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        bool found = false;
        for (uint256 i = 0; i < covens[id].wizards.length && !found; i++) {
            if (covens[id].wizards[i] == idWizard) {
                covens[id].wizards[i] = covens[id].wizards[covens[id].wizards.length-1];
                covens[id].wizards.pop();
                found = true;
            }
        }
        require(found);
        covens[id].maxScepters -= amountSlots;
    }

    function setWizardsApproveTo(Wizards wizard, address operator, bool approved) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        wizard.setApprovalForAll(operator, approved);
    }

    function setSceptersApproveTo(Scepters scepter, address operator, bool approved) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        scepter.setApprovalForAll(operator, approved);
    }

    function insertScepter(uint256 id, uint256 idScepter, uint256 amountResearchCapacity) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        covens[id].scepters.push(idScepter);
        covens[id].totalResearchCapacity += amountResearchCapacity;
    }

    function insertWizard(uint256 id, uint256 idWizard, uint256 amountSlots) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        covens[id].wizards.push(idWizard);
        covens[id].maxScepters += amountSlots;
    }

    function setLastInvestigation(uint256 id, uint256 timestamp) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        covens[id].latestPotionTime = timestamp;
    }

    function setPowerCrystals(uint256 id, uint256 amount) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have minter role to mint");
        covens[id].powerCrystals = amount;
    }

    function getPowerCrystalsOf(uint256 id) public view returns(uint256) {
        return covens[id].powerCrystals;
    }

    function getToken(uint256 id) public view virtual returns (Coven memory scepter) {
        return covens[id];
    }

    /**
     * @dev Pauses all token transfers.
     *
     * See {ERC721Pausable} and {Pausable-_pause}.
     *
     * Requirements:
     *
     * - the caller must have the `PAUSER_ROLE`.
     */
    function pause() public virtual {
        require(hasRole(PAUSER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have pauser role to pause");
        _pause();
    }

    /**
     * @dev Unpauses all token transfers.
     *
     * See {ERC721Pausable} and {Pausable-_unpause}.
     *
     * Requirements:
     *
     * - the caller must have the `PAUSER_ROLE`.
     */
    function unpause() public virtual {
        require(hasRole(PAUSER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have pauser role to unpause");
        _unpause();
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override(ERC721, ERC721Enumerable, ERC721Pausable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(AccessControlEnumerable, ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
